import {Pipe, PipeTransform} from "@angular/core";

@Pipe({
    name: 'rareteColor'
  })
  export class PokemonRarete implements PipeTransform {
    transform(rarete: string): string {
      switch (rarete) {
        case '*':
          return 'rgb(0, 0, 0)';
        case '**':
          return 'rgb(240, 93, 48)';
        case '****':
          return 'rgb(255, 215, 0)';
        default:
          return 'rgb(0, 0, 0)';
      }
    }
  }
